import React from 'react';
import Title from '../TtitleSection/TitleSection';
import './CardsSection.scss'

const CardsSection = () => {
  return (
    <>
      <section className='wrapper'>
          <Title text={'Cards'}/>
               
      </section>
     
    </>
  );
}

export default CardsSection;
